function SkuCore:bisLogin()
	SkuOptions.db.char[MODULE_NAME].bis = SkuOptions.db.char[MODULE_NAME].bis or {}
   SkuOptions.db.char[MODULE_NAME].bis.fiters = SkuOptions.db.char[MODULE_NAME].bis.fiters or {}
   SkuOptions.db.char[MODULE_NAME].bis.fiters.onlyPlayerClass = SkuOptions.db.char[MODULE_NAME].bis.fiters.onlyPlayerClass or L["On"]
   SkuOptions.db.char[MODULE_NAME].bis.fiters.phase = SkuOptions.db.char[MODULE_NAME].bis.fiters.phase or "T8"
   SkuCore:bisGetBisListData()
end

---------------------------------------------------------------------------------------------------------------------------------------
function SkuCore:bisGetBisTooltipInfo(aItemId)
   if not bisItemData[aItemId] then
      return
   end

   local tText
   local _, classId = UnitClassBase("player")
   local phaseName = SkuOptions.db.char[MODULE_NAME].bis.fiters.phase
   for x = 1, #bisItemData[aItemId] do
      local className = tClassSpecs[classId][0]
      if (SkuOptions.db.char[MODULE_NAME].bis.fiters.onlyPlayerClass == L["On"] and bisItemData[aItemId][x].class_name == className) or SkuOptions.db.char[MODULE_NAME].bis.fiters.onlyPlayerClass ~= true then
         tText = L["BIS info"]
         tText = tText.."\r\n"..L[className]
         tText = tText.."\r\n"..L[bisItemData[aItemId][x].spec_name]..": "..bisItemData[aItemId][x].slots[1].ranks
      end
   end

   if tText then
      return tText
   end
end

